The temptation was too big, too close, too obvious for her to ignore or resist. Having him in her bed made her burn inside, making her crotch wet and needy to the point that her heart was barely able to stay in the cage of her ribs. Her blood drove her hands to his shaft, and everything else has happened so fast...
